using System;
using System.Collections.Generic;
using Microsoft.EntityFrameworkCore;
using Zoo.Core.Domain;
using Zoo.Data.Mapping;

namespace Zoo.Data
{
    public class ZooObjectContext : DbContext
    {
        public ZooObjectContext(DbContextOptions<ZooObjectContext> options) 
            : base(options)
        {
            Database.EnsureCreated();
        }

        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {
            modelBuilder.ApplyConfiguration(new EmployeeMap());
            modelBuilder.ApplyConfiguration(new AnimalMap());
            modelBuilder.ApplyConfiguration(new HabitatMap());

            modelBuilder.Entity<Employee>().HasData(new List<Employee>
            {
                new Employee
                {
                    Id = 1,
                    FirstName = "Florin",
                    LastName = "Ciobanu",
                    BirthDate = DateTime.Now,
                    Picture = ""
                },
                new Employee
                {
                    Id = 2,
                    FirstName = "Abel",
                    LastName = "Reuben",
                    BirthDate = DateTime.Now,
                    Picture = ""
                }
            });

            modelBuilder.Entity<Habitat>().HasData(new List<Habitat>
            {
                new Habitat
                {
                    Id = 1,
                    Name = "African savanna",
                    Description = "The savanna is an open landscape of grasslands found in tropical Africa. It is home to an amazing variety of wildlife. For half of the year, savannas are hot and dry, and swept by wildfires. They also have a season of heavy rains. Tall grasses grow during the rainy season, providing food for herds of grazing animals such as zebras and wildebeest. The grazers are hunted by fearsome predators such as lions and cheetahs.",
                    Picture = ""
                },
                new Habitat
                {
                    Id = 2,
                    Name = "The Arctic",
                    Description = "The Arctic around the North Pole is mostly ocean. At its center, the Arctic is floating ice that never completely melts. Further out are the northern tips of the continents and the large island of Greenland. Most of the small plants and thick-haired animals, such as musk ox, in the region live on this land. The Arctic summer has daylight 24 hours a day. During this time, the ocean is full of tiny plants and animals called plankton. Animals as large as whales and polar bears come to feed on them. In winter, when more of the ocean freezes over and thick snow covers the land, animals and plants have adapted to keep warm and survive.",
                    Picture = ""
                },
            });

            modelBuilder.Entity<Animal>().HasData(new List<Animal>
            {
                new Animal
                {
                    Id = 1,
                    Name = "Lion",
                    Description = "Lion description...",
                    Picture =
                        "",
                    HabitatId = 1
                },
                new Animal
                {
                    Id = 2,
                    Name = "Tiger",
                    Description = "Lion description...",
                    Picture =
                        "",
                    HabitatId = 1
                },
                new Animal
                {
                    Id = 3,
                    Name = "Bear",
                    Description = "Bear description...",
                    Picture = "",
                    HabitatId = 2
                },
                new Animal
                {
                    Id = 4,
                    Name = "Reindeer",
                    Description = "Reindeer description...",
                    Picture = "",
                    HabitatId = 2
                }
            });

            base.OnModelCreating(modelBuilder);
        }
    }
}
